                <th scope="col"></th>
                <th scope="col">Name</th>
                <th scope="col">Gender</th>
                <th scope="col">Moblie Phone</th>
                <th scope="col">Nationality</th>
                <th className="text-right"></th>
                </tr>
            </thead>
            <tbody> 
                {props.user !== null
                ? props.user.map((users) => (
                    <td>{users.user_firstname}</td> 
                ))  
                : console.log("folder empty")
                } 
                {/* <tr> 
